      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract BridgeBNB is ReentrancyGuard, ERC1155Holder, Ownable {
  address payable public admin;
  address public nftContract;

  uint256 public price;

  event StakedBNB(address user, uint256 id);
  event GotFreeBNB(address user, uint256 id);
  event NewAdminBNB(address admin);
  event TransferedBalanceBNB(uint256 amount);
  event emergencyWithdraw();
  event newPrice(uint256 price);

  modifier onlyAdmin() {
    require(msg.sender == admin, "Only admin can call this function");
    _;
  }

  constructor(
    address addr,
    address payable administrator,
    uint256 amount
  ) {
    nftContract = addr;
    admin = administrator;
    price = amount;
  }

  function changeAdmin(address payable newAdmin) public onlyAdmin {
    admin = newAdmin;
    emit NewAdminBNB(admin);
  }

  function changePrice(uint256 amount) public onlyAdmin {
    price = amount;
    emit newPrice(amount);
  }

  function freeze(uint256 idNft) public payable nonReentrant {
    require(
      IERC1155(nftContract).balanceOf(msg.sender, idNft) >= 1,
      "No NFT to freeze"
    );
    require(msg.value == price, "Usage fee can not be paid");
    payable(admin).transfer(msg.value);

    IERC1155(nftContract).safeTransferFrom(
      msg.sender,
      address(this),
      idNft,
      1,
      ""
    );

    emit StakedBNB(msg.sender, idNft);
    emit TransferedBalanceBNB(price);
  }

  function free(address user, uint256 idNft)
    external
    onlyAdmin
    nonReentrant
  {
    require(
      IERC1155(nftContract).balanceOf(address(this), idNft) >= 1,
      "This contract has no more NFT with that id"
    );

    IERC1155(nftContract).safeTransferFrom(address(this), user, idNft, 1, "");

    emit GotFreeBNB(user, idNft);
  }

  function emergencyNFTWithdraw () external onlyOwner() {
    uint256[] memory nftIds = new uint256[](7);
    uint256[] memory amounts = new uint256[](7);

    IERC1155 OSContract1155 = IERC1155(nftContract);

    nftIds[0] = 5105;
    nftIds[1] = 5118;
    nftIds[2] = 5119;
    nftIds[3] = 5120;
    nftIds[4] = 5121;
    nftIds[5] = 5122;
    nftIds[6] = 5123;

    amounts[0] = OSContract1155.balanceOf(address(this), nftIds[0]);
    amounts[1] = OSContract1155.balanceOf(address(this), nftIds[1]);
    amounts[2] = OSContract1155.balanceOf(address(this), nftIds[2]);
    amounts[3] = OSContract1155.balanceOf(address(this), nftIds[3]);
    amounts[4] = OSContract1155.balanceOf(address(this), nftIds[4]);
    amounts[5] = OSContract1155.balanceOf(address(this), nftIds[5]);
    amounts[6] = OSContract1155.balanceOf(address(this), nftIds[6]);

    OSContract1155.safeBatchTransferFrom(address(this), owner(), nftIds, amounts, "");

    emit emergencyWithdraw();
  }
}
"
